export default function MeloVibePage() {
  return (
    <>
      {/* Title */}
      <div className="text-primary-text-color ">MeloVibes</div>

      {/* Body */}

      <div className="flex justify-between">
        {/* Header and paragraph */}
        <div className="text-primary-text-color">
          <span>Feel</span>

          <p>Feel <br />the vibe</p>
        </div>

        {/* Image and circle */}
        <div>Image</div>
      </div>
    </>
  );
}
